@sadanand-singh I've attempted to reproduce this issue using the following Postgres version: `PostgreSQL 12.1 on x86_64-apple-darwin18.7.0, compiled by Apple clang version 11.0.0 (clang-1100.0.33.12), 64-bit` with the following cases:

1. First, I created a fresh database on MLflow 1.7, logged runs, soft deleted them, and then ran `mlflow gc --backend-store-uri postgresql://<my_db_info>`. The `gc` command worked properly. I ran this in Python 2.7

2. Second, I tried (1) using Python 3.6.

3. Finally, I tried creating the postgres database on an older version of MLflow (1.2). Then, I upgraded to 1.7, upgraded the MLflow database state via Alembic with `mlflow db upgrade`, and attempted to log, soft delete, and then run `mlflow gc`; these steps worked as well.

___

@sadanand-singh Can you provide more information about the version of Postgresql that you're running, the version of MLflow that was initially used to create your MLflow + Postgres database, and which steps you took to set up the database initially?
